/*
It is convinent for me to create data using python then copy paste, and using INSERT statement. so I didn't use COPY statement this time.

From the information, I summary and list my understandings:
About each entity:
1. Experiment: 1 data, its attributes are:
    * Title: The effect of Doped semi-transparent materials on the refractive index of the material.
    * ResearchQuestion: Comparing undoped ones,does new doped material get higher refractive index?
    * Hypothesis: the refractive index's increment is lineal with the amount of doping.
    * Goal: test whether her new doped material offers, on average, a higher refractive index than its undoped counterpart, and whether such increment is lineal with the amount of doping.
    * TypeByNumberOfSessions: Cross-sectional
    * TypeByAllocation: Between-subjects
2. Researcher: Alice Smith
3. SimpleFactor: 1 data: doping process
4. CoFactor: 2 factors: illumination power, which level is 40(40mW); thickness of sample, which level is 2(2cm).
5. ConfoundingFactor: 1 factor: impurities number
6. Factor: 4 factors
7. Level: 4 levels: 0(undoped), 10(Doped with conc 10), 20(Doped with conc 20), 30(Doped with conc 30). 
8. PairSimpleFactorLevel: 4 pairs: doped-0, doped-10, doped-20, doped-30.
9. Treatment: 4 treatments, they all are in the PairSimpleFactorLevel entity.
10. ExperimentalUnit entity: 200 samples, description is "sample i" (i=1, 2, ..., 200).
11. Session: using cross-sesctional method to do experiment, so, it totally have 4 sessions.
12. Endpoint: it is correspond to the Session, 200 endpoints. its data com import from the given results.
13. Group: 4 groups.each group has 50 units and different treatment

About the relationship, the length of data:
14. ObservesEndpoint: 200
15. Conducts: 1
16. HasFactors: 4
17. HasTreatment: 4
18. TreatmentLevels: 4
19. OrganisesIntoSession: 4
20. MeasuresUnit:200
21. AdminstersTreatment: 4
22. GroupsUnit: 200
23. GetObservedValue: 200    note: experiment using between subject method, means that each unit only have one observed value. 

below is how to populate the data.
*/


